CurlP and Kerl are cryptographic sponge constructions. They are equipped with a memory state and a function that replaces the state memory using some input string. A portion of the memory state is then the output. In the sponge metaphor, the process of replacing the memory state by an input string is said to absorb the input, while the process of producing an output is said to squeeze out an output. The hash functions are expected to be used like this: curlp // Create a CurlP instance with 81 rounds.
// This is equivalent to calling `CurlP::new(CurlPRounds::Rounds81)`.
let mut curlp = CurlP81::new(); // Assume there are some transaction trits, all zeroes for the sake of this example.
let transaction = TritBuf::<T1B1Buf>::zeros(6561);
let mut hash = TritBuf::<T1B1Buf>::zeros(243); // Absorb the transaction.
curlp.absorb(&transaction);
// Squeeze out a hash.
curlp.squeeze_into(&mut hash); kerl // Create a Kerl instance.
let mut kerl = Kerl::new(); // `Kerl::digest` is a function that combines `Kerl::absorb` and `Kerl::squeeze`.
// `Kerl::digest_into` combines `Kerl::absorb` with `Kerl::squeeze_into`.
let hash = kerl.digest(&transaction); The main proposal of this RFC are the Sponge trait and the CurlP and Kerl types that are implementing it. This RFC relies on the presence of the types TritBuf and Trits, as defined by RFC36 , which are assumed to be owning and borrowing collections of binary-encoded ternary in the T1B1 encoding (one trit per byte). /// The common interface of cryptographic hash functions that follow the sponge construction and that act on ternary.
trait Sponge { /// An error indicating that a failure has occured during a sponge operation. type Error; /// Absorb `input` into the sponge. fn absorb(&mut self, input: &Trits) -> Result<(), Self::Error>; /// Reset the inner state of the sponge. fn reset(&mut self); /// Squeeze the sponge into a buffer. fn squeeze_into(&mut self, buf: &mut Trits) -> Result<(), Self::Error>; /// Convenience function using `Sponge::squeeze_into` to return an owned version of the hash. fn squeeze(&mut self) -> Result<TritBuf, Self::Error> { let mut output = TritBuf::zeros(HASH_LENGTH); self.squeeze_into(&mut output)?; Ok(output) } /// Convenience function to absorb `input`, squeeze the sponge into a buffer `buf`, and reset the sponge in one go. fn digest_into(&mut self, input: &Trits, buf: &mut Trits) -> Result<(), Self::Error> { self.absorb(input)?; self.squeeze_into(buf)?; self.reset(); Ok(()) } /// Convenience function to absorb `input`, squeeze the sponge, and reset the sponge in one go. /// Returns an owned version of the hash. fn digest(&mut self, input: &Trits) -> Result<TritBuf, Self::Error> { self.absorb(input)?; let output = self.squeeze()?; self.reset(); Ok(output) }
} Following the sponge metaphor, an input provided by the user is absorbed, and an output will be squeezed from the data structure. digest is a convenience method calling absorb and squeeze in one go. The *_into versions of these methods are for passing a buffer, into which the calculated hashes are written. The internal state will not be cleared unless reset is called.

